        <div>
<iframe width="420" height="315"
src='https://www.youtube.com/embed/${videoId}'>
</iframe>
<div> 
<p> {title} </p> 
<button onClick={() => {history.push(`/Videos/${videoId}`)}}> Details</button>
</div>


        </div>
    )
}
